package com.github.cao.awa.lang;

import com.github.cao.awa.lang.expression.*;
import com.github.cao.awa.modmdo.utils.time.TimeUtil;
import com.github.zhuaidadaya.rikaishinikui.handler.conductor.string.builder.*;
import com.mysql.cj.util.*;

public class CaoLang {
    public static void main(String[] args) {
        try {
            long start = TimeUtil.millions();
            Expression.optimize =false;
            StringBuilderConductor conductor = new StringBuilderConductor();
            Expression exp = Expression.parseExp("""
                    
                    
                    
                    
                    
                    
                    
                    
                    
                    
                    
                    
                    
                    
                    
                    
                    
                    
                    
                    
                    
                    
                    
                    
                    """);
            exp.optimize();
            exp.buildTree(conductor, "");

//            System.out.println(conductor.toString());
//            exp.print();
            System.out.println(conductor);
            System.out.println("Done in " + TimeUtil.processMillion(start) + "ms");
        } catch (Exception ex) {
            ex.printStackTrace();
        }
    }
}
